@yans.if didn’t have to get it from the media when I watched him do it my guy. It’s all on camera. 

Not many people think Biden will be a great president. And plenty of left wing people have criticised and continue to criticise him. Funnily enough, that’s a good thing. That’s why so many of us saw and see Trump supporters as a cult; even after funnelling tax money into his businesses, paying off pornstars to cover affairs, openly denying the severity of COVID, openly requesting that foreign governments interfere in US elections, mocking disabled people, increasing the number of drone strikes far above even what it became under Obama, and pretending he won the election when he lost despite not having any evidence to support the claim his supporters continue to fanatically support him. A man who said he’d drain the swamp and then proceeded to have a team fuelled by nepotism and corruption. It’s genuinely concerning that so many people have been conned by this man. 

These claims aren’t media spin. It was all on camera. I’ve read the court documents for several of the election trials.
